import React from 'react';
import './App.css';

const AboutPage = () => {
  const members = [
    {
      name: 'Imashi Thakshila',
      imageUrl: 'https://example.com/john-avatar.png',
      role: 'Lead Developer',
      description: 'John is an experienced developer with a passion for creating user-friendly websites and applications.',
    },
    {
      name:'Tharushi Dilisha',
      imageUrl:'',
      role:'',
      description:'jaigjaio',
    },
    // Add more members here
  ];

  return (
    <div className="about-page">
      <header className="about-header">
        <h1>About Us</h1>
      </header>
      <main className="about-main">
        <p>
          We are a team of passionate developers who specialize in creating
          beautiful and user-friendly websites and applications. Our mission is
          to help businesses grow by providing exceptional digital solutions.
        </p>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/Group_people_icon.jpg/1200px-Group_people_icon.jpg"
          alt="BGimage"
          className="about-image"
        />
        <div className='about-members'>
          <h2>Meet the members</h2>
          <div className='member-container'>
            {members.map((member, index) => (
              <div className='member' key={index}>
                <img
                  src={member.imageUrl}
                  alt={`${member.name} avatar`}
                  className='member-avatar'
                />
                <h3>{member.name}</h3>
                <p>{member.role}</p>
                <p>{member.description}</p>
              </div>
            ))}
          </div>
        </div>
      </main>
    </div>
  );
};

export default AboutPage;
